import { faCopy } from "@fortawesome/free-regular-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";
import "./slider.css";

export default function Slider(props) {
    const responsive = {
        desktop: {
            breakpoint: {max: 3000, min: 1024},
            items: 3,
            slidesToSlide: 3 // optional, default to 1.
        },
        tablet: {
            breakpoint: {max: 1024, min: 464},
            items: 2,
            slidesToSlide: 2 // optional, default to 1.
        },
        mobile: {
            breakpoint: {max: 464, min: 0},
            items: 1,
            slidesToSlide: 1, // optional, default to 1.
            partialVisibilityGutter: 150
        }
    };
    console.log(props)
    return (
        <Carousel responsive = {responsive}
                  arrows = {true}
                  autoPlay = {false}
                  autoPlaySpeed = {3000}
                  containerClass = "container"
                  draggable = {true}
                  focusOnSelect = {false}
                  keyBoardControl = {false}
                  minimumTouchDrag = {80}
                  renderButtonGroupOutside = {false}
                  renderDotsOutside = {false}
                  partialVisbile = {true}
                  className = "carousal-container"
        >
            {/*{photos.map((photo, i) => (*/}
            {/*    <div className = "hotelImgWrapper">*/}
            {/*        <img onClick = {() => handleOpen(i)} src = {photo.src} alt = "HotelImage"*/}
            {/*             className = "hotelImg" />*/}
            {/*    </div>*/}
            {/*))}*/}
            {props.sliderimg.map((image, i) => (
                <div className = "trendingCards" key = {i}>
                    <img
                        src = {image.src}
                        alt = "TrendingImage"
                        className = "trImg" />

                    <div className = "trDesc">
                        <p className = {props.highLightState === true ? "trHighlight" : "noHighLight"}>
                            {props.highListText}
                        </p>
                        <p className = "trCaption">
                            {props.title}
                        </p>
                        <small>
                            <span className = {props.subtitleIconState === true ? '' : 'noHighLight'}>
                                <FontAwesomeIcon icon = {faCopy} /></span>
                            {props.subtitleText}
                        </small>
                    </div>
                </div>
            ))}
        </Carousel>
    )
}
